query:
mutation policyAppTenantRestrictionDiscardPolicyRevision ( $accountId:ID! $appTenantRestrictionPolicyMutationInput:AppTenantRestrictionPolicyMutationInput $policyDiscardRevisionInput:PolicyDiscardRevisionInput) {
	policy ( accountId:$accountId ) {
		appTenantRestriction ( input:$appTenantRestrictionPolicyMutationInput  )  {
			discardPolicyRevision ( input:$policyDiscardRevisionInput   ) {
				policy {
					enabled
					rules {
						audit {
							updatedTime
							updatedBy
						}
						rule {
							id
							name
							description
							index
							section {
								id
								name
							}
							enabled
							application {
								id
								name
							}
							headers {
								name
								value
							}
							source {
								ip
								host {
									id
									name
								}
								site {
									id
									name
								}
								subnet
								ipRange {
									from
									to
								}
								globalIpRange {
									id
									name
								}
								networkInterface {
									id
									name
								}
								siteNetworkSubnet {
									id
									name
								}
								floatingSubnet {
									id
									name
								}
								user {
									id
									name
								}
								usersGroup {
									id
									name
								}
								group {
									id
									name
								}
								systemGroup {
									id
									name
								}
								country {
									id
									name
								}
							}
							schedule {
								activeOn
								customTimeframe {
									from
									to
								}
								customRecurring {
									from
									to
									days
								}
							}
							action
							severity
						}
						properties
					}
					sections {
						audit {
							updatedTime
							updatedBy
						}
						section {
							id
							name
						}
						properties
					}
					audit {
						publishedTime
						publishedBy
					}
					revision {
						id
						name
						description
						changes
						createdTime
						updatedTime
					}
				}
				status
				errors {
					errorMessage
					errorCode
				}
			}
		}
	}	
}
